import React from "react";
import Menu from "./Menu";
import Links from "./Links";

import {
  MainContainer,
  StyledDiv1,
  Name,
  StyledDiv2,
  Cactus,
  MenuDiv,
  CactusTooltip
} from "./styles/App";

function App() {
  return (
    <MainContainer>
      <StyledDiv1>
        <Name>katherine szelag</Name>

      </StyledDiv1>
      <StyledDiv2>
        <Links />
        <MenuDiv>
          <Menu />
        </MenuDiv>
      </StyledDiv2>
    </MainContainer>
  );
}

export default App;
